					["custom"] = "aura_env.playerGUID = UnitGUID(\"player\")\n\naura_env.ThreatFunc = function(unit)\n    local firstUnit, secondUnit\n    local firstThreat, secondThreat = 0, 0\n    local threat, pet\n    for member in WA_IterateGroupMembers() do\n        threat = select(5, UnitDetailedThreatSituation(member, unit))\n        if threat then\n            if threat > firstThreat then\n                secondUnit = firstUnit\n                secondThreat = firstThreat\n                firstUnit = member\n                firstThreat = threat\n            elseif threat > secondThreat then\n                secondUnit = member\n                secondThreat = threat\n            end\n        end\n        \n        pet = member..\"pet\"\n        if UnitExists(pet) then\n            threat = select(5, UnitDetailedThreatSituation(pet, unit))\n            if threat then\n                if threat > firstThreat then\n                    secondUnit = firstUnit\n                    secondThreat = firstThreat\n                    firstUnit = pet\n                    firstThreat = threat\n                elseif threat > secondThreat then\n                    secondUnit = pet\n                    secondThreat = threat\n                end\n            end\n        end\n    end\n    return firstUnit, firstThreat, secondUnit, secondThreat\nend\n\n-- Function taken from this WA https://wago.io/Hyq2PB0KQ\naura_env.getIconTexture = function (n)\n    return (\"|TInterface\\\\TARGETINGFRAME\\\\UI-RaidTargetingIcon_%d.png:0|t\"):format(n or 1) \nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["customVariables"] = "{\n    threatPct = {\n        display = \"Threat Percent\",\n        type = \"number\",\n    }, \n    absThreatDiff = {\n        display = \"Absolute Threat Diff\",\n        type = \"number\",\n    },\n    threatToAggro = {\n        display = \"Threat until Aggro\",\n        type = \"number\",\n    }, \n    unitId = {\n        display = \"Unit ID\",\n        type = \"number\",\n    },\n    status = {\n        display = \"Threat Status\",\n        type = \"select\",\n        values = {\n            [1] = \"Untanked\", \n            [2] = \"Insecurely Tanking\", \n            [3] = \"Tanking\",\n        }\n    },\n}",
						["event"] = "Health",
						["unit"] = "player",
						["subeventPrefix"] = "SPELL",
						["spellIds"] = {
						},
						["events"] = "UNIT_THREAT_LIST_UPDATE, CLEU:UNIT_DIED, PLAYER_REGEN_ENABLED",
						["names"] = {
						},
						["check"] = "event",
						["custom"] = "function(allStates, event, ...)\n    if event == \"UNIT_THREAT_LIST_UPDATE\" then\n        local unitId = ...\n        if UnitIsPlayer(unitId) then\n            return\n        end\n        \n        local isTanking, threatStatus, scaledPercentage, rawPercentage, threatValue = UnitDetailedThreatSituation(\"player\", unitId)\n        if not threatValue then\n            return \n        end\n        \n        local _, firstThreat, _, secondThreat = aura_env.ThreatFunc(unitId)\n        local guid = UnitGUID(unitId)\n        allStates[guid] = allStates[guid] or {unit = unitId}\n        local state = allStates[guid]\n        \n        local threatDiff\n        local threatToAggro\n        if isTanking then\n            threatDiff = threatValue - secondThreat\n            threatToAggro = threatDiff\n        else\n            threatDiff = threatValue - firstThreat\n            if scaledPercentage ~= 0 then\n                threatToAggro = (threatValue / (scaledPercentage/100)) - threatValue\n            else\n                threatToAggro = threatDiff\n            end\n        end\n        \n        state.changed = true\n        state.show = true\n        state.progressType = \"static\"\n        state.total = 100\n        state.value = Round(scaledPercentage * 10) / 10\n        local raidMarker = GetRaidTargetIndex(unitId)\n        if raidMarker then\n            state.name = aura_env.getIconTexture(raidMarker) .. UnitName(unitId)\n        else\n            state.name = UnitName(unitId)\n        end\n        \n        state.unitId = unitId\n        state.threatPct = state.value\n        state.unitTarget = unitId .. \"target\"\n        state.absThreatDiff = AbbreviateNumbers(Round(math.abs(threatDiff) / 100)) or threatDiff\n        state.threatToAggro = AbbreviateNumbers(Round(threatToAggro / 100)) or threatToAggro\n        state.status = threatStatus < 1 and 1 or threatStatus\n        \n        \n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and select(8, ...) ~= aura_env.playerGUID then\n        local guid = select(8, ...)\n        if allStates[guid] then\n            allStates[guid].show = false\n            allStates[guid].changed = true\n        end\n        \n    elseif event == \"PLAYER_REGEN_ENABLED\" or (event == \"COMBAT_LOG_EVENT_UNFILTERED\" and select(8, ...) == aura_env.playerGUID) then\n        for _, v in pairs(allStates) do\n            v.show = false\n            v.changed = true\n        end\n    end\n    return true\nend",
