			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "-- copy/paste the block below to use Debug_Print in other weakauras:\n\n--[[\n---------------------------------------------\n--************** Debug_Print ***************\n---------------------------------------------\naura_env.debug_print = function(group,msg,...)\n    return WeakAuras.ScanEvents(\"DPRINT\",group,aura_env.id,msg,...) --comment this line out to disable all debug messages from this aura\nend\n]]\n\n\nlocal enabled = aura_env.config.enabled\nlocal types = aura_env.config.groups\nlocal enabledGroups = {}\nfor i, groupOptions in ipairs(aura_env.config.groups) do\n    if groupOptions.enabled then\n        enabledGroups[i] = {\n            [\"name\"] = groupOptions.name,\n            [\"keywords\"] = {strsplit(\",\",groupOptions.lastWords)},\n            [\"disableKV\"] = groupOptions.disableKV,\n            [\"prefixDisable\"] = groupOptions.prefixDisable,\n            [\"prefixColor\"] = groupOptions.prefixColor,\n            [\"msgColor\"] = groupOptions.msgColor,\n            [\"keyColor\"] = groupOptions.keyColor,\n            [\"valColor\"] = groupOptions.valColor,\n        }\n    end\nend\nlocal RGBATableToHexString = function(rgbaNormalizedTable)\n    local r,g,b,a = unpack(rgbaNormalizedTable)\n    r,g,b,a = tostring(r*255), tostring(g*255), tostring(b*255),tostring(a*255)\n    return format(\"%02x%02x%02x%02x\",a,r,g,b)\nend\naura_env.d_print = function(group,prefix,msg,...)\n    if enabled == true then\n        prefix = prefix or \"\"\n        local keywords,disableKV,disablePrefix = {},true,false\n        local prefixColor,msgColor,keyColor,valColor = \"ffff8000\",\"ffba006d\",\"ff464646\",\"ffffffff\" -- default color values\n        if not group then group = \"default\" end\n        --get formatting from user options\n        for i, groupOptions in ipairs(enabledGroups) do\n            if groupOptions.name == group then\n                keywords = groupOptions.keywords or {}\n                disableKV = groupOptions.disableKV\n                if groupOptions.prefixDisable then prefix = \"\" end\n                prefixColor = RGBATableToHexString(groupOptions.prefixColor)\n                msgColor = RGBATableToHexString(groupOptions.msgColor)\n                keyColor = RGBATableToHexString(groupOptions.keyColor)\n                valColor = RGBATableToHexString(groupOptions.valColor)\n                break\n            end\n        end\n        --format prefix\n        prefix = tostring(prefix)..\":\"\n        --format varargs: odd indexes -> keys, even indexes -> values\n        local args, lastKey = {...}, false\n        if disableKV == true then lastKey = true end\n        for i=1,select(\"#\",...)do\n            args[i] = tostring(args[i])\n            if (i % 2) ~= 0 then\n                if lastKey == false then\n                    for ii, word in ipairs(keywords) do\n                        if args[i] == word then lastKey = true end\n                    end\n                    args[i] = \"\\n   \"..WrapTextInColorCode(args[i],keyColor)..\":\"\n                else\n                    args[i] = WrapTextInColorCode(args[i],valColor)\n                end\n            else\n                args[i] = \"\"..WrapTextInColorCode(args[i],valColor)..\"\"\n            end\n        end\n        msg = tostring(msg)\n        prefix = \"\\n\"..WrapTextInColorCode(prefix,prefixColor)\n        msg = WrapTextInColorCode(msg,msgColor)\n        \n        local frame = ChatFrame1\n        local buffer = prefix..\" \"..msg\n        for i,arg in ipairs(args) do                \n            buffer = buffer..arg..\" \"\n        end  \n        \n        if (aura_env.config.useChatframe) then            \n            if aura_env.config.chatFrame == 2 then\n                frame = ChatFrame2\n            elseif aura_env.config.chatFrame == 3 then\n                frame = ChatFrame3\n            elseif aura_env.config.chatFrame == 4 then\n                frame = ChatFrame4\n            elseif aura_env.config.chatFrame == 5 then\n                frame = ChatFrame5\n            elseif aura_env.config.chatFrame == 6 then\n                frame = ChatFrame6\n            elseif aura_env.config.chatFrame == 7 then\n                frame = ChatFrame7\n            elseif aura_env.config.chatFrame == 8 then\n                frame = ChatFrame8\n            elseif aura_env.config.chatFrame == 9 then\n                frame = ChatFrame9\n            elseif aura_env.config.chatFrame == 10 then\n                frame = ChatFrame10\n            end      \n        end\n        return frame:AddMessage(buffer)\n        \n    end\nend",
