			["customText"] = "function()\n    \n    local baseDefense,armorDefense = UnitDefense(\"player\");\n    local talentName = select(1, GetTalentInfo(2,16,1)) -- Change numbers to match what you  want (tier, column, spec)\n    if talentName == \"Survival of the Fittest\" then\n        aura_env.talentDruid = select(5, GetTalentInfo(2,16,1))\n    else \n        aura_env.talentDruid = 0\n    end\n    aura_env.baseCritRed = (baseDefense + armorDefense)*0.04 + GetCombatRatingBonus(16) + aura_env.talentDruid; \n    aura_env.crit70Chance = 19 - aura_env.baseCritRed\n    aura_env.crit71Chance = 19.2 - aura_env.baseCritRed\n    aura_env.crit72Chance = 19.4 - aura_env.baseCritRed\n    aura_env.crit73Chance = 19.6 - aura_env.baseCritRed\n    if aura_env.crit70Chance <= 0 then\n        return WrapTextInColorCode(string.format(\"%0.2f%%\",(aura_env.crit70Chance)),\"ff61bd4f\");\n    end\n    if aura_env.crit70Chance > 0 then\n        return WrapTextInColorCode(string.format(\"%0.2f%%\",(aura_env.crit70Chance)),\"ffEE0000\");\n    end\nend",
